script: |
  super -f text -I q5135.spq | sort > q5135.out

inputs:
  - name: q5135.spq
    data: |
      SELECT DISTINCT col2 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT - 6 BETWEEN col0 AND ( col1 * - 65 - col0 );
  - name: tab1

outputs:
  - name: q5135.out
    data: |
      59
      68
      96
